import { useState } from "react";
import Header from "../Header";

const Game = () => {
  const [userInput, setUserInput] = useState("");

  return (
    <>
      <Header />
      <div>
        <p>{userInput}</p>
        <input
          type="text"
          value={userInput}
          onChange={(event) => {
            setUserInput(event.target.value);
          }}
        />
      </div>
    </>
  );
};
export default Game;
